const Define2= () => {
  return (
    <section className="hero2" id='hero2'>
    <div className='text-black' id='Hero2'> 
    <div className='w-[90%] mx-auto my-20 rounded-3xl drop-shadow-2xl py-3 px-3 transform hover:bg-z-600 transition duration-500 hover:scale-105'>
      <div className='w-[100%] mx-auto my-10 py-3 px-3 '>



    <div className='max-w-[800px] mt-[10px] w-full h-full mx-auto text-center flex flex-col justify-center'>
       <h1 className='md:text-4xl sm:text-3xl text-xl font-bold md:py-1'>Define</h1>
       <p className='md:text-2xl text-xl font-bold text-gray-500 md:py-3 py-3'>Text</p>
        </div>
        </div>
        </div>
        </div>

        </section>
  );
};

export default Define2;
